import React from 'react';
import './styles.css';
import Banner from './Banner';
import Main from './Main';

const App = () => (
  <div className='App'>
    <div className="App-header">
      <Banner/>
      <div className="relative">
        <Main />
      </div>
    </div>
  </div>
);

export default App;
